jobDescription:
- Setting up an automated infrastructure on Google Cloud using Terraform, GitHub Actions, and Rancher Kubernetes Engine;
- Setting up with Helm Chart an observability stack using Prometheus, Grafana, and Alert Manager to send notifications on Slack;
- Separating metrics and logs per namespaces using Prometheus federator;
- Deploying a web app, managing the config files of the resources deployed in the cluster using Lens;
- Automate the deploying of a Spring Boot/Angular/MySQL app on AKS using GitHub Actions pipeline;
- Kubernetes cluster administration.
